  function onsubtract(current, subtract) {
    console.log("[Current] " + current.a + " " + current.b + " " + current.c);
    console.log("[Subtract] " + subtract.a + " " + subtract.b + " " + subtract.c);
    
    var result = JSON.parse(JSON.stringify(current));

    if (subtract.a > 0) {
      result.a = current.a - subtract.a;
      if (result.a < 0) {
        errorNagativeNum(current.a);        
        return;
      }
    } else if (subtract.b > 0) {
      result.b = current.b - subtract.b;
      if (result.b < 0) {
        errorNagativeNum(current.b);
        return;
      }
    } else if (subtract.c > 0) {
      result.c = current.c - subtract.c;
      if (result.c < 0) {
        errorNagativeNum(current.c);
        return;
      }
    } else {
      errorNoInput();
      return;
    }

    NimView.render({heap: result});

    setTimeout(function() {
      MessageView.render({type: 'turn', msg: '컴퓨터 차례입니다.'});
      
      var newHeap = turnMachine(result);
      if (newHeap == null) {
        setTimeout(function() {
          MessageView.render({type: 'turn', msg: '당신이 이겼습니다! :)'});
          NimView.newGame();
        }, 150);        
      } else {
        setTimeout(function() {
          NimView.render({heap: newHeap});
          if (newHeap.a + newHeap.b + newHeap.c == 1) {
            MessageView.render({type: 'turn', msg: '컴퓨터가 이겼습니다! :D'});  
            NimView.newGame();
          } else {
            MessageView.render({type: 'turn', msg: '당신 차례입니다.'});  
          }          
        }, 150);        
      }
    }, 100);
  }

  function turnMachine(heap) {
    var newHeap = null;

    if (heap.a + heap.b + heap.c == 1) {
      return newHeap;
    }

    var i = 0;
    for (i; i < 100; i++) {
      newHeap = makeWinHeap(heap);
      if (isWinHeap(newHeap)) {
        break;
      }
    }
     
    console.log('found: ' + i + ", heap: " + newHeap.a + " " + newHeap.b + " " + newHeap.c);
    return newHeap;
  }

  function availableHeap(heap) {
    var available = [];
    if (heap.a != 0) {
      available.push(0);
    }

    if (heap.b != 0) {
      available.push(1);
    }

    if (heap.c != 0) {
      available.push(2);
    }

    return available;
  }

  function makeWinHeap(heap) {
    var heap = JSON.parse(JSON.stringify(heap));
    var available = availableHeap(heap);  
    if (available.length == 0) {
      console.log("[Exception] array is empty!");
    }

    var index = getRandomInt(0, available.length);
    if (available[index] == 0) {
      heap.a -= getRandomInt(1, heap.a);
    } else if (available[index] == 1) {
      heap.b -= getRandomInt(1, heap.b);
    } else {
      heap.c -= getRandomInt(1, heap.c);
    }

    //console.log(heap.a + ' ' + heap.b + ' ' + heap.c);
    return heap;
  }

  function isWinHeap(heap) {
    var result = false;

    for (var i = 0; i < winHeap.length; i++) {
      var result = equals({a: heap.a, b: heap.b, c: heap.c}, winHeap[i]);
      if (result == true) {
        break;
      }

      result = equals({a: heap.a, b: heap.c, c: heap.b}, winHeap[i]);
      if (result == true) {
        break;
      }

      result = equals({a: heap.b, b: heap.a, c: heap.c}, winHeap[i]);
      if (result == true) {
        break;
      }

      result = equals({a: heap.b, b: heap.c, c: heap.a}, winHeap[i]);
      if (result == true) {
        break;
      }

      result = equals({a: heap.c, b: heap.a, c: heap.b}, winHeap[i]);
      if (result == true) {
        break;
      }

      result = equals({a: heap.c, b: heap.b, c: heap.a}, winHeap[i]);
      if (result == true) {
        break;
      }
    }

    return result;
  }

  function equals(obj1, obj2) {
    function _equals(obj1, obj2) {
        return JSON.stringify(obj1)
            === JSON.stringify($.extend(true, {}, obj1, obj2));
    }
    return _equals(obj1, obj2) && _equals(obj2, obj1);
  }

  function errorNoInput() {
    MessageView.render({type: 'error', msg: '숫자를 입력하세요.'});  
  }

  function errorNagativeNum(validNum) {
    if (validNum > 0) {
      MessageView.render({type: 'error', msg: validNum + '보다 작은 숫자를 입력하세요.'});
    } else {
      MessageView.render({type: 'error', msg: '이 그룹에서는 더 이상 숫자를 뺄 수 없습니다.'});
    }
  }

  function getRandomInt(lower, upper) {
    return Math.floor(lower + (Math.random() * (upper - lower + 1)));
  }

  return {
    start: start,
    onsubtract: onsubtract
  };
